BEGIN 
CREATE VIEW DIM_HOUR (HOUR_ID,OFFICE_TIME,DAY_TIME,NIGHT_TIME) AS select HOUR_ID,max(OFFICE_TIME),max(DAY_TIME),max(NIGHT_TIME) from DIM_TIME group by HOUR_ID
END
', 0 );
BEGIN 
CREATE view NEW_DATES(DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY) as select DATE_ID+7, YEARS(DATE_ID+7), DATEPART(mm,DATE_ID+7), DAY(DATE_ID+7), DATEPART(cwk,DATE_ID+7), DOW(DATE_ID+7) , case (DOW(DATE_ID+7)) when 6 then 0 when 7 then 0 else 1 end from dc.dim_date where date_id > (select max(date_id)-7 from dc.dim_date)
END', 0 );
DROP VIEW SELECT_DWH_BASE_AGGLEVEL; 
BEGIN 
create view
  SELECT_DWH_BASE_AGGLEVEL(FIRSTDATE_ID,AGGLEVEL,DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY,
  TIMELEVEL,TIMELEVELBH,DAYS)
  as select FIRSTDATE_ID,AGGLEVEL,DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY,
  TIMELEVEL,TIMELEVELBH,DAYS from dc.SELECT_AGGLEVEL_TABLE
  WHERE TIMELEVELBH = ''DAYBH''
commit
grant select on SELECT_DWH_BASE_AGGLEVEL to dcbo
END', 0 );
